import { AiOutlineGoogle } from 'react-icons/ai';

export default function Navbar(){
    return (
        <nav>
            <div className="navleft">
                <p>Mochinomi</p>
            </div>
            <div className="navright">
                <AiOutlineGoogle size={32} />
            </div>

        </nav>
    );
}
